
--
-- Table structure for table `Flight`
--


CREATE TABLE Flight (
  [FlightId] int NOT NULL identity,
  [CapacityFirstClass] int NOT NULL,
  [CapacityEconomy] int NOT NULL,
  [PriceFirstClass] decimal(6,2) NOT NULL,
  [PriceEconomy] decimal(6,2) NOT NULL,
  [TimeDeparture] datetime NOT NULL,
  [TimeArrival] datetime NOT NULL,
  [AirportDeparture] nvarchar(255) REFERENCES AirportCode(Code),
  [AirportArrival] nvarchar(255) REFERENCES AirportCode(Code),
  CHECK (TimeDeparture < TimeArrival),
  PRIMARY KEY (FlightId)
) ;



